import './App.css';
import Chat from './Chat';

function App() {
  return (
    <BrowserRouter>
      <header className="App-header">
        <Header />
      </header>
      {/* Routes define which component to render for each URL */}
      <Routes>
        <Route path="/" element={<Chat />} />
        {/* <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} /> */}
      </Routes>
    </BrowserRouter>
  );
}

function Header(){
  return (
    <ul class="nav">
      <li><Link to="/">Chat</Link></li>
      <li><Link to="/summarizer">Web Summarizer</Link></li>
      <li><Link to="/brochure">Web Brochure</Link></li>
    </ul>
  );
}
export default App;
